 <body class="theme-dark" style="user-select: text;">
  <h1>
   G1533 εἰσφέρω
  </h1>
  <h2>
   eisphérō
  </h2>
  <p>
   <em>
    (ice-fer'-o | ees-FEH-roh | ees-FAY-roh)
   </em>
  </p>
  <h3>
   Definition
  </h3>
  <p>
   from [G1519] and [G5342]; to carry inward (literally or figuratively); bring (in), lead into.
  </p>
  <ul>
   <li>
    to bring into, in or to
   </li>
   <li>
    to lead into
   </li>
  </ul>
  <h3>
   See also
  </h3>
  <p>
   [G1519], [G5342]
  </p>
 </body>
